import React from "react";
import "./styles/component.css";
import { getInventoryItemDef } from "@d2api/manifest-web";
import { DestinyActivityDefinition } from "bungie-api-ts/destiny2";

type weeklyNightfallResponse = {
	nightfallActivities: DestinyActivityDefinition[] | undefined;
};

type MyProps = {};

type MyState = {
	apiResponse: weeklyNightfallResponse;
};

class WeeklyNightfall extends React.Component<MyProps, MyState> {
	constructor(props: MyProps) {
		super(props);
		this.state = {
			apiResponse: {
				nightfallActivities: undefined
			},
		};
	}

	getWeeklyNightfallRewards() {
		fetch("http://localhost:5000/api/weekly_nightfall")
			.then(res => res.json())
			.then(res => this.setState({ apiResponse: res }));
	}

	componentDidMount() {
		this.getWeeklyNightfallRewards();
	}

	render() {
		if (this.state !== null) {
			
			return (
				<div className='bg-teal itemCard'>
					<div className='display-in-row center-vertical'>
						
					</div>
				</div>
			);
		}
	}
}

export default WeeklyNightfall;
